['#include<stdio.h>
int main()
{
        int n,n1,n2;
        scanf("%d%d%d",&n,&n1,&n2);
        if(n1+n2<=n)
        {
                int i,a[n],j,sum1=0,sum2=0;
                float res;
                for(i=0;i<n;i++)
                {
                        scanf("%d",&a[i]);
                }
                for(i=0;i<n-1;i++)
                {
                        for(j=0;j<n-1-i;j++)
                        {
                                if(a[j]<a[j+1])
                                {       a[j]=a[j]+a[j+1];
                                        a[j+1]=a[j]-a[j+1];
                                        a[j]=a[j]-a[j+1];
                                }
                        }
                }
                for(i=0;i<((n1<n2)?n1:n2);i++)
                        sum1+=a[i];
                for(j=((n1<n2)?n1:n2);j<i+((n1<n2)?n2:n1);j++)
                        sum2+=a[j];
                res=(sum1/((n1<n2)?n1:n2))+(sum2/((n1<n2)?n2:n1));
                printf("%f",res);
                return 0;
        }
}']

